import React, { Suspense, useState } from "react";
import styled from "styled-components";
import { useRouteData, useParams, useNavigate } from "react-suspense-router";

import { GitHubRepoData } from "./GitHubSearch.data";

const SearchResult: React.FC = () => {
  const repoData = useRouteData() as GitHubRepoData;
  return (
    <ul>
      {repoData.items.map(item => (
        <li key={item.id}>
          <a href={item.html_url}>{item.full_name}</a>
        </li>
      ))}
    </ul>
  );
};

const Loading = styled.div`
  background-color: yellow;
  margin: 20px 0;
  padding: 20px 0;
  text-align: center;
  &::after {
    content: 'Searching...';
  }
`;

// just to make the bundle size a bit bigger
const logo = "";

const GitHubSearch: React.FC = () => {
  const navigate = useNavigate();
  const { query: initialQuery } = useParams();
  const [query, setQuery] = useState(initialQuery);
  return (
    <div>
      <h1>GitHub repositories</h1>
      <div>
        Query:
        <input value={query} onChange={e => setQuery(e.target.value)} />
        <button type="button" onClick={() => navigate(`../${query}`)}>
          Refresh
        </button>
      </div>
      <Suspense fallback={<Loading />}>
        <SearchResult />
      </Suspense>
      <div style={{ display: 'none' }}>{logo}</div>
    </div>
  );
};

export default GitHubSearch;
